import logo from './logo.svg';
import './App.css';

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

const tarefas = ['Acordar', 'Comer', 'Banho', 'Estudar', 'Exercicio']

class App extends React.Component {
  render() {
    return (
      <ul>{ tarefas.map((t) => Task(t)) }</ul>
    );
  }
}

export default App;
